script: |
  super -f text -I q3110.spq | sort > q3110.out

inputs:
  - name: q3110.spq
    data: |
      SELECT DISTINCT 7 + + col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col0 NOT IN ( - col0 * - col1 * + col0 / CAST ( NULL AS INTEGER ) + 10 + - col1 );
  - name: tab1

outputs:
  - name: q3110.out
    data: |
